import React from 'react'
import { Line } from 'react-chartjs-2'
const Record = () => {
  return (
    <div>
      <Line
      data={{
        labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
      }}
    />
    </div>
  );
};

export default Record;
